import React from 'react';
import styled from 'styled-components';

const ContainerDiv = styled.div`
display: flex;
justify-content: space-evenly;
flex-wrap:wrap;
align-items:space-evenly;

`
const CardDiv = styled.div `
padding: 1rem;
width:25%;
margin: 1rem;
line-height: 2rem;
const Header = styled.h1
padding:.3rem;
text-shadow: -1.5px -1.5px 0 #003F87, 1.5px 1.5px 0 #003F87, 0 -1.5px 0 #003F87,
	0 1.5px 0 #003F87, 1.5px -1.5px 0 #003F87, -1.5px 1.5px 0 #003F87, 1.5px 0 0 #003F87,
    -1.5px 0 0 #003F87; 
letter-spacing: 1px;
font-size:1rem;
border-radius:10px;
letter-spacing:.2rem;
color:skyblue;
box-shadow: 3px 3px 3px 3px #00B2EE;
border: 1px solid #003F87;
`

function TeacherList({teachers}){
    return(
    <ContainerDiv>
        {teachers.name.map(teacher => (
            <CardDiv key={teacher}>
                <h2>{teacher}</h2>
                <div>Subject: Math</div>
                <div>Times_available: 2pm-6pm mon-fri </div>
                <div>Location: Philly</div>
                <button>Request Help</button>
            </CardDiv>
        ))}

    </ContainerDiv>)
}

export default TeacherList;
